import { httpService } from './';
import { apiUrl } from '../config';


export const biddingHistory={
    getBiddingHistory
}
const baseUrl= `${apiUrl}/auction/biddingHistory?auctonId=`


function getBiddingHistory(auctionId) {    
    return httpService.get(baseUrl+auctionId);
}
